import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: []
    };
  }

componentDidMount() {
  fetch('https://jsonplaceholder.typicode.com/users')
  .then(response => response.json())
  .then(users => this.setState({monsters: users}));
}

render() {
  return (
    <div className="App">
      {
        this.state.monesters.map(monsters=> (
          <h1 key={monesters.id}>{monsters.name}</h1>
          ))
      }
    </div>
  );
}

}



export default App;
